import {
  SOCKET_TRIGGER_CONNECT, SOCKET_CONNECT_ERROR, SOCKET_ERROR,
  SOCKET_TIMEOUT, SOCKET_CONNECT, SOCKET_DISCONNECT,
  SOCKET_TRIGGER_DISCONNECT
} from './actionTypes';

export function connectToSocket() {
  return { type: SOCKET_TRIGGER_CONNECT };
}
